Tips for Working with SAQL Queries in the Query Editor

Queries created or edited in the query editor have unique characteristics compared to other queries. Review the following tips:

Sorting in a Stacked Bar or Stacked Column Chart

Sorting works differently in stacked bar and stacked column charts depending on whether the underlying query is created in the lens or query editor.

If you customize the query in the query editor, the results sort differently—even if you don’t change the sort order. The same bars appear, but in a different order. 

To see the difference, let’s start by creating a stacked bar chart in the lens and then editing it in the query editor.

The SAQL query for a chart created or edited in the query editor looks like this:

q = load "case95";
result = group q by ('Account.Industry', 'Account.Type');
result = foreach result generate q.'Account.Industry' as 'Account.Industry', q.'Account.Type' as 'Account.Type', count(q) as 'A';
result = group result by ('Account.Industry', 'Account.Type');
result = foreach result generate 'Account.Industry', 'Account.Type', sum(A) as 'A', sum(sum(A)) over ([..] partition by 'Account.Industry' ) as 'B';
result = order result by ('B' desc);
result = limit result 2000;

To hide a column in the query editor, click the dropdown arrow for that measure and select Hide. The hidden measure will appear under Unused Fields in the left pane.

NOTE: If you hide a column in the query editor and then edit the SAQL query, the column will display again.
